        this.state = {
            id : 1,
            description : 'Learn Forms',
            targetDate : moment(new Date()).format('YYYY-MM-DD')
        }
    }

    render() {
        return (
        <div>

            <h1>Todo</h1>
            <div className = "container">
                <Formik>
                    {
                        (props) => (
                            <div>Something</div>
                        )
                    }
                </Formik>
            </div>


        </div>
        )
    }
}

export default TodoComponent;
